/* ************************************ */
/* Define helper functions */
/* ************************************ */
var getInstructFeedback = function() {
  return '<div class = centerbox><p class = center-block-text>' + feedback_instruct_text + '</p></div>'
}

/* ************************************ */
/* Define experimental variables */
/* ************************************ */
// generic task variables
var sumInstructTime    = 0; // ms
var instructTimeThresh = 0; // seconds

// task specific variables
var stim = ''
var runTime  = 0  // ms
var taskTime = 900 // 15 minutes in seconds

/* ************************************ */
/* Set up jsPsych blocks */
/* ************************************ */

var bc_first_block = {
  type: 'poldrack-single-stim',
  stimulus: '<div class=centerbox><p class = center-block-text>Place your attention on the breath.</p>' + 
  '<p class = center-block-text>Press the down arrow after your first exhale as you count "one", ' +
  'then close your eyes and continue counting breaths and pressing the correct arrow key.</p></div>',
  is_html: true,
  data: {
    trial_id: "breath_counting"
  },
  choices: [40, 39],     // 40 = down arrow, 39 = right arrow
  timing_response: -1,   // until response
  response_ends_trial: true,
  timing_post_trial: 0,
  on_finish: function() {
    jsPsych.data.addDataToLastTrial({'addingOnTrial': 'added!'})
  }
}
var bc_block = {
  type: 'poldrack-single-stim',
  stimulus: stim,
  is_html: true,
  data: {
    trial_id: "breath_counting"
  },
  choices: [40, 39],     // 40 = down arrow, 39 = right arrow
  timing_response: -1,   // until response
  response_ends_trial: true,
  timing_post_trial: 0,
  on_finish: function() {
    jsPsych.data.addDataToLastTrial({'addingOnTrial': 'added!'})
  }
}
var bc_node = {
  timeline: [bc_block],
  /* stopping criteria */
  loop_function: function(data) {
    for (i = 0; i < data.length; i++) {
      if ((data[i].trial_type == 'poldrack-single-stim') && (data[i].rt != -1)) {
        rt = data[i].rt
        runTime = runTime + rt
      }
    }
    // FIXME: Only times out on keypress _after_ duration
    console.log('runTime = ' + runTime);
    if (runTime <= taskTime * 1000) {
      return true
    } else if (runTime > taskTime * 1000) {
      return false
    }
  }
}
var beep = function() {
    var snd = new Audio("data:audio/wav;base64,");  
    snd.play();
}
var beep_block = {
  type: 'call-function',
  func: beep
}

//Set up post task questionnaire
var post_task_block = {
   type: 'survey-text',
   data: {
       trial_id: "post task questions"
   },
   questions: ['<p class = center-block-text style = "font-size: 20px">Please summarize what you were asked to do in this task.</p>',
              '<p class = center-block-text style = "font-size: 20px">Do you have any comments about this task?</p>'],
   rows: [15, 15],
   columns: [60,60]
};

/* define static blocks */
var end_block = {
  type: 'poldrack-text',
  data: {
    exp_id: "breath-counting-task",
    trial_id: "end"
  },
  text: '<div class = centerbox><p class = center-block-text>Great job and thank you! You are now finished with this part of the study.' +
'</p><p class = center-block-text>Press <strong>enter</strong> to continue.</p></div>',
  cont_key: [13],
  timing_response: 180000,
  timing_post_trial: 0
};

var feedback_instruct_text =
  'Welcome to the experiment. Press <strong>enter</strong> to begin.'
var feedback_instruct_block = {
  type: 'poldrack-text',
  data: {
    trial_id: "instruction"
  },
  cont_key: [13],
  text: getInstructFeedback,
  timing_post_trial: 0,
  timing_response: 180000
};

/// This ensures that the subject does not read through the instructions too quickly.  If they do it too quickly, then we will go over the loop again.
var instructions_block = {
  type: 'poldrack-instructions',
  data: {
    trial_id: "instruction"
  },
  pages: [
    "<div class=centerbox><p class=block-text>In this task, we would like you to be aware of your breath.</p>" +
    "<p class=block-text>Close your eyes and ask yourself the question, 'Am I breathing in, or breathing out?'.  Do this until you have counted 3 in breaths, and 3 out breaths, then open your eyes.</p></div>",
    "<div class=centerbox><p class=block-text>Use this same technique when counting your breaths in this task.  There's no need to control the breath.  Just breathe normally.</p>" +
    "<p class=block-text>At some point, you may notice your attention has wandered from the breath.  That's okay.  Just gently place it back on the breath.</p></div>",
    "<div class=centerbox><p class=block-text>To help attention stay with the breath, you'll use a small part of your attention " +
    "to silently count breaths from 1 to 9, again and again.  <em>An in and out breath together make one count.</em></p>" +  
    "<p class=block-text>Say the count softly in your mind so it only gets a little attention while most of the attention is on feeling the breath.</p>" +
    "<p class=block-text>Please press the <em><strong>down arrow</strong> once for each of <strong>breaths 1-8</strong></em>, " + 
    "and the <em><strong>right arrow</strong> once on <strong>breath 9</strong>.</em>  This means you'll be pressing a button once with each breath.</p></div>",
    "<div class=centerbox><p class=block-text>We suggest you sit in an upright, relaxed posture that feels comfortable.</p>" +
    "<p class=block-text>Place the keyboard in your lap, so that you can comfortably rest the index and middle fingers of your dominant hand over the down arrow and right arrow keys.</p>" +
    "<p class=block-text>The task will last about 15 minutes.  Your eyes will be closed, so a tone will sound to end the task.</p></div>"
  ],
  allow_keys: false,
  show_clickable_nav: true,
  timing_post_trial: 500
};

var instruction_node = {
  timeline: [feedback_instruct_block, instructions_block],
  /* This function defines stopping criteria */
  loop_function: function(data) {
    for (i = 0; i < data.length; i++) {
      if ((data[i].trial_type == 'poldrack-instructions') && (data[i].rt != -1)) {
        rt = data[i].rt
        sumInstructTime = sumInstructTime + rt
      }
    }
    if (sumInstructTime <= instructTimeThresh * 1000) {
      feedback_instruct_text =
        'Read through instructions too quickly.  Please take your time and make sure you understand the instructions.  Press <strong>enter</strong> to continue.'
      return true
    } else if (sumInstructTime > instructTimeThresh * 1000) {
      feedback_instruct_text =
        'Done with instructions. Press <strong>enter</strong> to continue.'
      return false
    }
  }
}

/* create experiment definition array */

var breath_counting_task_experiment = [];
breath_counting_task_experiment.push(instruction_node);
breath_counting_task_experiment.push(bc_first_block);
breath_counting_task_experiment.push(bc_node);
breath_counting_task_experiment.push(beep_block);
breath_counting_task_experiment.push(end_block);
